import React from 'react'
import axios from "axios";

import {Link} from "react-router-dom"
import { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';

function MealPlans() {

    const [listOfMealPlans, setlistOfMealPlans] = useState([]);
    const [listOfRecipes, setlistOfRecipes] = useState([]);
    const email = sessionStorage.getItem("email");
    let id;
    const navigate = useNavigate();

    useEffect(() => {
        axios.get(`http://localhost:3001/authentication/${email}`).then((response) => {
            id = response.data;
        });
        axios.get(`http://localhost:3001/mealplans/all/${id}`).then((response) => {
          setlistOfMealPlans(response.data);
          //console.log(response.data);
        });
      }, []);

  return (
    <div className="App">
        <Link to="/">Back</Link>
        <div className='mealPlans'>
        {listOfMealPlans.map((value, key) => { 
        return (
          <div className="mealPlan" >
            <div className='name'>{value.name}</div> 
            <div className='body'>
                <div className='type'>Scope: {value.type}</div>
                <div className='recipes'>
                    Recipes: {Object.entries(value.recipes).map(([key, value]) => (
                        <span key={key}>
                        {key}: {value}{', '}
                        </span>
                    ))}
                </div>

            </div>
          </div>
        );
      })}
      </div>
    </div>
  )
}

export default MealPlans
